import React from 'react';
import Friend from './friend.js';

const SingleFriend = props => {
  return props.friends === undefined ? (
    <div>Loading</div>
  ) : (
    <Friend
      {...props}
      name={friend.name}
      age={friend.age}
      email={friend.email}
      key={friend.id}
      id={friend.id}
    />
  );
};

export default SingleFriend;
